import React, { useState, useEffect } from "react";

export default props => {
  useEffect(() => {
    fetch("http://www.youtube.com/").then(resp => {
      console.log(resp);
      alert("loaded");
    });
  }, []);

  return (
    <div>
      <h1>Test</h1>
    </div>
  );
};
